import React, { useState, useEffect } from 'react';
import './StartWorkout.css';

function StartWorkout({ onBackClick, user }) {
  const [workouts, setWorkouts] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    // מניעת גלילה של הגוף כשהמסך פתוח
    document.body.style.overflow = 'hidden';

    // פונקציה לטעינת האימונים העתידיים
    const fetchWorkouts = async () => {
      try {
        setLoading(true);

        // נתונים לדוגמה - תחליף עם קריאה לשרת אמיתית
        setTimeout(() => {
          const demoWorkouts = [
            {
              id: 1,
              date: '2024-01-15',
              time: '18:00',
              court: 'מגרש כדורגל',
              duration: 60,
              type: 'אימון כדורגל'
            },
            {
              id: 2,
              date: '2024-01-17',
              time: '19:30',
              court: 'מגרש כדורסל',
              duration: 90,
              type: 'אימון כדורסל'
            },
            {
              id: 3,
              date: '2024-01-20',
              time: '17:00',
              court: 'חדר כושר',
              duration: 75,
              type: 'אימון כוח'
            }
          ];

          setWorkouts(demoWorkouts);
          setLoading(false);
        }, 2000); // סימולציה של טעינה

      } catch (error) {
        console.error('שגיאה בטעינת האימונים:', error);
        setLoading(false);
      }
    };

    fetchWorkouts();

    // החזרת הגלילה כשיוצאים מהמסך
    return () => {
      document.body.style.overflow = 'unset';
    };
  }, [user?.id]);

  // פונקציה למיון האימונים לפי מגרש
  const groupWorkoutsByCourt = () => {
    const grouped = {};

    workouts.forEach(workout => {
      if (!grouped[workout.court]) {
        grouped[workout.court] = [];
      }
      grouped[workout.court].push(workout);
    });

    return grouped;
  };

  // פונקציה לעיצוב התאריך
  const formatDate = (dateString) => {
    const date = new Date(dateString);
    return date.toLocaleDateString('he-IL', {
      weekday: 'long',
      year: 'numeric',
      month: 'long',
      day: 'numeric'
    });
  };

  const handleStartWorkout = (workoutId) => {
    console.log('מתחיל אימון:', workoutId);
    // כאן תוסיף את הלוגיקה להתחלת אימון
  };

  const handleBookNewWorkout = () => {
    console.log('מעבר להזמנת אימון חדש');
    // כאן תוסיף את הלוגיקה למעבר למסך הזמנת אימון
  };

  const groupedWorkouts = groupWorkoutsByCourt();

  return (
    <div className="start-workout-container">
      <button className="back-button" onClick={onBackClick}>
        חזרה
      </button>

      <div className="start-workout-content">
        <h1>האימונים העתידיים שלך</h1>

        {loading ? (
          <div className="loading">
            <p>טוען את האימונים שלך...</p>
          </div>
        ) : workouts.length === 0 ? (
          <div className="no-workouts">
            <p>אין לך אימונים עתידיים מתוכננים</p>
            <button className="no-workouts-button" onClick={handleBookNewWorkout}>
              הזמן אימון חדש
            </button>
          </div>
        ) : (
          <div className="workouts-list">
            {Object.entries(groupedWorkouts).map(([court, courtWorkouts]) => (
              <div key={court} className="court-section">
                <h2 className="court-title">{court}</h2>
                <div className="workouts-grid">
                  {courtWorkouts.map(workout => (
                    <div key={workout.id} className="workout-card">
                      <div className="workout-header">
                        <h3>{workout.type}</h3>
                        <span className="workout-duration">{workout.duration} דקות</span>
                      </div>
                      <div className="workout-details">
                        <p className="workout-date">{formatDate(workout.date)}</p>
                        <p className="workout-time">שעה: {workout.time}</p>
                      </div>
                      <button 
                        className="start-workout-btn"
                        onClick={() => handleStartWorkout(workout.id)}
                      >
                        התחל אימון
                      </button>
                    </div>
                  ))}
                </div>
              </div>
            ))}
          </div>
        )}
      </div>
    </div>
  );
}

export default StartWorkout;
